  \"2015-08-21T22:47:11.782472\",\n\t\"name\": \"residency-allocation-database\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Residency Allocation Database is used
  to determine allocation of funds for residency programs offered by Veterans Affairs
  Medical Centers (VAMCs). Information for the database comes from any VAMC that has
  made a funding request for its residency programs. The Office of Academic Affiliations
  distributes worksheets and memos are sent to participating VAMCs. VAMC personnel
  enter the information electronically into the database housed at the Academic Information
  Management Center (AIMC) located in St. Louis, Missouri. The data entry and collection
  process is done annually beginning in September and ending in December. The main
  user of this database is the Office of Academic Affiliations.\",\n\t\"license_title\":
